import React from "react";

const FilterPrice = () => {
  const radios = [
    {
      id: 1,
      name: "radio_one",
    },
    {
      id: 2,
      name: "radio_two",
    },
    {
      id: 3,
      name: "radio_three",
    },
  ];

  return (
    <>
      {radios?.map((radio) => (
        <div>radio.name</div>
      ))}
    </>
  );
};

export default FilterPrice;
